#include <stdlib.h>
#include <stdio.h>

#define NODOS 20000
#define QUERIES 9000

int nodos[NODOS];
int queries[QUERIES];

typedef struct bin_tree_node{
    struct bin_tree_node* child0;
    struct bin_tree_node* child1;
    int key;
} BT_NODE;

BT_NODE *root = NULL;

void insert(int key){
    BT_NODE *aux;
    if(root == NULL){
        root = (BT_NODE*) malloc(sizeof(BT_NODE));
        root->child0 = NULL;
        root->child1 = NULL;
        root->key = key;
    } else {
        aux = root;
        while(1){
            if(aux->key > key){
                if(aux->child0 == NULL){
                    aux->child0 = (BT_NODE*) malloc(sizeof(BT_NODE));
                    aux->child0->child0 = NULL;
                    aux->child0->child1 = NULL;
                    aux->child0->key = key;
                    break;
                }else{
                    aux = aux->child0;
                }
            } else {
                if(aux->child1 == NULL){
                    aux->child1 = (BT_NODE*) malloc(sizeof(BT_NODE));
                    aux->child1->child0 = NULL;
                    aux->child1->child1 = NULL;
                    aux->child1->key = key;
                    break;
                }else{
                    aux = aux->child1;
                }
            }
        }
    }
}

BT_NODE* find(int key){
    BT_NODE *aux;
    if(root != NULL){
        aux = root;
        while(aux != NULL){
            if(aux->key == key){
                return aux;
            } else if(aux->key > key){
                aux = aux->child0;
            } else {
                aux = aux->child1;
            }
        }
    }
    return NULL;
}



int main(){
    int i;
    for(i = 0; i < NODOS; i++){
        insert(nodos[i]);
    }

    for(i = 0; i < QUERIES; i++){
        find(queries[i]);
    }
    return 0;
}

